import Navigation from './Navigation';

const Banner = () => (
  <div className="banner">
     <Navigation />
    <img id="background" src="https://lh3.googleusercontent.com/pw/ADCreHfWTO6Hob8ejGAmlkoIFHBcdJJJGFl8UquPlGZby40NiwRn5REJhMmvZC-aMorD5zOF_7JVRR7N_gJWljpFOTpmTvMSe0j1ZfHtcQ5f8PpkPFroW0w=w600-h152-p-k" alt="Banner" />
  </div>
);

export default Banner;
